       (1, 4, NULL, 'https://en.wikipedia.org/wiki/Food', '<b>Food</b> - Wikipedia', 'Food is any substance consumed to provide nutritional support for an organism.Food is usually of plant, animal or fungal origin, and contains essential nutrients, such as carbohydrates, fats, proteins, vitamins, or minerals.The substance is ingested by an organism and assimilated by the organisms cells to provide energy, maintain life, or stimulate growth.', NULL, NULL, NULL),
       (1, 5, NULL, 'https://www.ifood.it/', 'iFood | infinito Amore per il Cibo', 'iFood √® un portale che ruota attorno al Cibo e alle sue mille sfumature: ricette, fotografie, libri, viaggi, persone, luoghi e storie. √à il rumore perfetto della crosta del pane, il movimento delle mani infarinate, la combinazione degli odori che rimandano ad un viaggio, al piatto assaggiato in un mondo lontano.', NULL, NULL, NULL),
       (1, 6, NULL, 'https://www.dictionary.com/browse/food', '<b>Food</b> | Definition of <b>Food</b> at Dictionary.com', 'Food definition, any nourishing substance that is eaten, drunk, or otherwise taken into the body to sustain life, provide energy, promote growth, etc. See more.', NULL, NULL, NULL),
       (1, 7, NULL, 'https://www.gruppofood.com/', 'Gruppo <b>Food</b> - Home - Gruppo <b>Food</b>', 'Gruppo Food mette a disposizione di industria e distribuzione alimentare servizi integrati per informare, formare e garantire perfomance competitive nellambito della comunicazione e del marketing. Business Journalism. Informazione costante sul mercato con opinioni, analisi, ...', NULL, NULL, NULL),
       (1, 8, NULL, 'https://www.slowfood.it/', 'Slow <b>Food</b> - Buono, Pulito e Giusto', 'Slow Food √® una associazione internazionale no profit impegnata a ridare valore al cibo, nel rispetto di chi produce, in armonia con ambiente ed ecosistemi, grazie ai saperi di cui sono custodi territori e tradizioni locali', NULL, NULL, NULL),
       (1, 9, NULL, 'https://www.journals.elsevier.com/food-chemistry/', '<b>Food</b> Chemistry - Journal - Elsevier', 'Food Chemistry has two open access companion journals Food Chemistry: X and Food Chemistry: Molecular Sciences.. The Aims and Scope of Food Chemistry are assessed and modified on an annual basis to reflect developments in the field. This means that research topics that have been deemed in scope previously may now fall outside of the scope of the journal as our scientific and technical ...', NULL, NULL, NULL),
       (1, 10, NULL, 'http://www.fao.org/home/en/', 'Home | <b>Food and Agriculture Organization</b> of the United Nations', 'The Food and Agriculture Organization (FAO) is a specialized agency of the United Nations that leads international efforts to defeat hunger.', NULL, NULL, NULL),
       (2, 1, NULL, 'https://vimeo.com/248591160', 'SpaceX Falcon 9 Rocket Launch', 'Follow me:  https://www.facebook.com/JesseWatsonPhotography https://instagram.com/jessewatsonphoto  https://youtube.com/user/cyclemonkey?sub_confirmation=1 twitter.com/IamJesseWatson Timelapse video of the SpaceX Falcon 9 rocket launch from Vandenberg AFB as seen from Yuma, Arizona  Ive been following the SpaceX launches online for some time now and have been in awe of the footage I‚Äôve seen. I found out about this specific launch from Vandenberg Air Force Base a few days prior to the event. I wanted to capture this amazing spectacle in a fashion that I haven‚Äôt seen previously, as most of what I have seen is cell phones video or news reels.   This particular launch was close to my hometown in Yuma, Arizona, roughly 400 miles away but perfectly viewable for people in Arizona. I‚Äôve one previous rocket launch years ago from White Sands Missile range in the morning time at sunrise and knew with the correct lighting from sunset that this launch had the opportunity to pop in a dramatic...', 'https://i.vimeocdn.com/video/674160323_640x360.jpg?r=pad', 360, 640),
       (2, 2, NULL, 'https://vimeo.com/242601060', 'SpaceX:  We Choose', 'Director: Stash Capar Production: Sequoia Content Executive Producer: Suzanne Allan Producer: Katy Maravala DP: Kristofer Bonnell Production Designer: Brad Wilson Casting:  Mann Casting Editor:  Stash Capar Music:  Nikhil Seetharam Colour: Tricia Hagoriles @ Alter Ego Producer at Alter Ego:  Jane Garrah VFX:  Aaron Pozzer Sound Design: Kendra Welham', 'https://i.vimeocdn.com/video/666536754_640x360.jpg?r=pad', 360, 640),
       (2, 3, NULL, 'https://vimeo.com/180528272', 'SpaceX - Igniting Interest In Space Exploration', 'Thank you Elon Musk and all of the SpaceX team for igniting a generations interest in space exploration.  Music: KS Rhoads - Our Corner Of The Universe  Video: SpaceX NASA TV  Audio: 60 Minutes - Elon Musk Profile Piece The WorldPost - Key Innovations Of The Future | Elon Musk', 'https://i.vimeocdn.com/video/588777761_640x360.jpg?r=pad', 360, 640),
       (2, 4, NULL, 'https://vimeo.com/338361997', 'SpaceX Starlink objects train 24 May 2019', 'The train of Starlink satellites passing over Leiden, the Netherlands, about 22.5 hours after launch. Video with WATEC 902H + Canon FD 1.8/50 mm lens, GPS time inserter. Note for Media: you may freely use this video in newsitems, as long as you acknowledge the source (Marco Langbroek, Leiden, the Netherlands)', 'https://i.vimeocdn.com/video/785882047_640x360.jpg?r=pad', 360, 640),
       (2, 5, NULL, 'https://vimeo.com/41703786', 'SpaceX Texas Rocket Development Facility', 'An overview of SpaceXs Rocket Development Facility in McGregor, Texas.  Take a tour with SpaceX VP of Propulsion Tom Mueller.', 'https://i.vimeocdn.com/video/290688806_640x360.jpg?r=pad', 360, 640),
       (2, 6, NULL, 'https://vimeo.com/41871757', 'SpaceX Launch 12/8/10', 'Video summary of the December 8, 2010, COTS 1 Mission, the first launch of a Dragon spacecraft.  SpaceXs Falcon 9 rocket launched from the Cape Canaveral Air Force Station carrying a Dragon spacecraft. On that day, SpaceX became the first commercial company in history to successfully send a spacecraft to orbit and return it safety back to Earth.', 'https://i.vimeocdn.com/video/290680205_640x360.jpg?r=pad', 360, 640),
       (2, 7, NULL, 'https://vimeo.com/64615482', 'SpaceX Grasshopper 250m Test', 'SpaceXs Grasshopper flies 820 feet, tripling its March 7th leap.   Grasshopper is a 10-story Vertical Takeoff Vertical Landing (VTVL) vehicle that SpaceX has designed to test the technologies needed to return a rocket back to Earth intact. While most rockets are designed to burn up in the atmosphere during reentry, SpaceXs rockets are being designed to return to the launch pad for a vertical landing.', 'https://i.vimeocdn.com/video/436773445_640x360.jpg?r=pad', 360, 640),
       (2, 8, NULL, 'https://vimeo.com/184564192', 'SpaceX Interplanetary Transport System', '', 'https://i.vimeocdn.com/video/594037091_640x360.jpg?r=pad', 360, 640),
       (2, 9, NULL, 'https://vimeo.com/252569579', 'SpaceX - We Choose', 'Director: Stash Capar Production: Sequoia Content Executive Producer: Suzanne Allan Producer: Katy Maravala DP: Kristofer Bonnell Production Designer: Brad Wilson Casting: Mann Casting Editor: Stash Capar Music: Nikhil Seetharam Colour: Tricia Hagoriles @ Alter Ego Producer at Alter Ego: Jane Garrah VFX: Aaron Pozzer Sound Design: Kendra Welham', 'https://i.vimeocdn.com/video/679242718_960x398.jpg?r=pad', 398, 960),
       (2, 10, NULL, 'https://vimeo.com/108391685', 'Dragonland (A SpaceX Tribute)', '"Dragonland" is a music montage honoring SpaceX, specifically the robotic Dragon cargo ship and the recently announced Dragon V2 that will fly crew to the International Space Station and, later in the decade, the Bigelow Aerospace expandable habitats.  The music "Dragonland" is from the new album "Sun" by Thomas Bergersen.  You can download the album via his web site at www.thomasbergersen.com.  Visit our web site at www.spaceksc.com.  Were on Twitter at @SpaceKSCBlog.', 'https://i.vimeocdn.com/video/492058063_640x360.jpg?r=pad', 360, 640),
       (3, 1, NULL, 'https://www.youtube.com/watch?v=xFPoIU5iiYQ', 'A Whale&#39,s Tale | Hope Works', 'A whale helps smaller sea creatures who are trapped in plastic waste. On land a young boy seeks support to clear the sea in his area. Fishermen come to his aid ...', 'https://i.ytimg.com/vi/xFPoIU5iiYQ/hqdefault.jpg', 360, 480),
